*/
import React, { Component } from "react";
import { Container, Row, Col, Table } from "react-bootstrap";

import Card from "components/Card/Card.jsx";
import { thInventoryArray, tdInventoryArray } from "variables/Variables.jsx";

class Inventory extends Component {
  render() {
    return (
      <div className="content">
        <Container fluid>
          <Row>
            <Col md={12}>

                  <Table striped hover>
                    <thead>
                      <tr>
                        {thInventoryArray.map((prop, key) => {
                          return <th key={key}>{prop}</th>;
                        })}
                      </tr>
                    </thead>
                    <tbody>
                      {tdInventoryArray.map((prop, key) => {
                        return (
                          <tr key={key}>
                            {prop.map((prop, key) => {
                              return <td key={key}>{prop}</td>;
                            })}
                          </tr>
                        );
                      })}
                    </tbody>
                  </Table>
            </Col>

          </Row>
        </Container>
      </div>
    );
  }
}

export default Inventory;
